// src/pages/About.js
import React from 'react';

const About = () => {
  return (
    <div
      className="min-h-screen bg-cover bg-center text-gray-800"
      style={{
        backgroundImage: "url('https://png.pngtree.com/thumb_back/fh260/background/20190221/ourmid/pngtree-delivery-banner-poster-background-image_12237.jpg')",
      }}
    >
      <div className="bg-white bg-opacity-90 py-16 px-6">
        <div className="container mx-auto">

          {/* Heading Section */}
          <h1 className="text-5xl font-bold text-center mb-12 text-blue-700">
            About Jiibly
          </h1>

          {/* Mission Section */}
          <section className="mb-16">
            <div className="grid md:grid-cols-2 gap-8 items-center">
              <div>
                <h2 className="text-3xl font-semibold mb-4 text-gray-800">Our Mission</h2>
                <p className="text-lg leading-7 text-gray-700">
                  Jiibly is committed to revolutionizing the delivery industry with exceptional service,
                  ensuring that your packages are handled with care and delivered on time. Our goal is to
                  make logistics seamless and accessible for everyone.
                </p>
              </div>
              <img
                src="https://source.unsplash.com/800x500/?delivery"
                alt="Delivery service"
                className="rounded-lg shadow-lg"
              />
            </div>
          </section>

          {/* How It Works Section */}
          <section className="mb-16">
            <h2 className="text-3xl font-semibold text-gray-800 text-center mb-10">How It Works</h2>
            <div className="grid md:grid-cols-4 gap-6 text-center">
              {[
                { step: 1, title: 'Place Your Order', img: 'https://source.unsplash.com/300x300/?online,order' },
                { step: 2, title: 'We Pick It Up', img: 'https://source.unsplash.com/300x300/?pickup,logistics' },
                { step: 3, title: 'Secure Transport', img: 'https://source.unsplash.com/300x300/?transport,delivery' },
                { step: 4, title: 'Timely Delivery', img: 'https://source.unsplash.com/300x300/?package,delivery' },
              ].map(({ step, title, img }) => (
                <div key={step} className="bg-white p-6 rounded-lg shadow-lg hover:scale-105 transition transform">
                  <img src={img} alt={title} className="w-full h-40 object-cover rounded-t-lg mb-4" />
                  <h3 className="text-xl font-bold text-blue-600">{`Step ${step}`}</h3>
                  <p className="text-gray-700 mt-2">{title}</p>
                </div>
              ))}
            </div>
          </section>

          {/* Why Choose Us Section */}
          <section className="mb-16">
            <h2 className="text-3xl font-semibold text-gray-800 text-center mb-10">Why Choose Jiibly?</h2>
            <div className="grid md:grid-cols-3 gap-8">
              {[
                {
                  title: 'Reliability',
                  text: 'Our team ensures your packages are delivered with precision and care.',
                  img: 'https://source.unsplash.com/400x300/?reliable,delivery',
                },
                {
                  title: 'Efficiency',
                  text: 'We optimize every step to guarantee timely and efficient delivery.',
                  img: 'https://source.unsplash.com/400x300/?efficient,delivery',
                },
                {
                  title: 'Support',
                  text: 'Our 24/7 customer support is always here to assist you.',
                  img: 'https://source.unsplash.com/400x300/?customer,service',
                },
              ].map(({ title, text, img }) => (
                <div key={title} className="flex flex-col items-center text-center bg-white p-6 rounded-lg shadow-lg">
                  <img src={img} alt={title} className="w-full h-48 object-cover rounded-lg mb-4" />
                  <h3 className="text-xl font-bold text-blue-600">{title}</h3>
                  <p className="text-gray-700 mt-2">{text}</p>
                </div>
              ))}
            </div>
          </section>

          {/* Call to Action */}
          <section className="text-center">
            <h2 className="text-3xl font-semibold text-gray-800 mb-6">Ready to Experience Jiibly?</h2>
            <button className="px-8 py-4 bg-blue-600 text-white text-lg font-bold rounded-lg shadow-lg hover:bg-blue-700 transition">
              Explore Our Services
            </button>
          </section>

        </div>
      </div>
    </div>
  );
};

export default About;
